import React from "react";

function Skills() {
  return (
    <>
      <div className="skill mt-5">
        <h2>Skills</h2>
        <ul className="list">
          <li>HTML</li>
          <li>CSS</li>
          <li>JavaScript</li>
          <li>BootStrap</li>
          <li>Reactjs</li>
          <li>Nodejs</li>
          <li>MySQL</li>
          <li>MongoDB</li>
        </ul>
      </div>
    </>
  );
}

export default Skills;
